import React from "react";
import '../Components/Navbar.css'

export default function Navbar() {
    return(
        <div className="navbar">
            <h1>Brett Wallin</h1>
            <p>About Me</p>
            <p>Projects</p>
            <p>Resume</p>
            <p>Contact Me</p>
        </div>
    )
}
